/****** Object:  StoredProcedure [dbo].[ObtenerPorcentajeFirmasPorDocumento]    Script Date: 12/11/2024 21:40:35 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[ObtenerPorcentajeFirmasPorDocumento]
AS
BEGIN
    SET NOCOUNT ON;

    SELECT 
        d.Id AS IdDocumento,
        d.Nombre AS NombreDocumento,
        COUNT(ud.IdUsuario) AS TotalAsignados,
        COUNT(CASE WHEN ud.Firmado = 1 THEN 1 END) AS TotalFirmados,
        COUNT(CASE WHEN ud.Firmado = 0 THEN 1 END) AS TotalNoFirmados,
        CAST(COUNT(CASE WHEN ud.Firmado = 1 THEN 1 END) * 100.0 / NULLIF(COUNT(ud.IdUsuario), 0) AS DECIMAL(5, 2)) AS PorcentajeFirmado,
        CAST(COUNT(CASE WHEN ud.Firmado = 0 THEN 1 END) * 100.0 / NULLIF(COUNT(ud.IdUsuario), 0) AS DECIMAL(5, 2)) AS PorcentajeNoFirmado
    FROM 
        Documentos d
    LEFT JOIN 
        UsuarioDocumento ud ON d.Id = ud.IdDocumento
    GROUP BY 
        d.Id, d.Nombre
    ORDER BY 
        PorcentajeFirmado DESC;
END;
GO
