CREATE PROCEDURE [dbo].[sp_i_carrito]
	@IdProducto INT,
	@IdUsuario INT,
	@Cantidad INT = NULL
AS
BEGIN
	IF EXISTS (SELECT 1 FROM Carrito WHERE IdProducto = @IdProducto AND IdUsuario = @IdUsuario)
	BEGIN
		IF (@Cantidad is null)
		BEGIN
			UPDATE Carrito
			SET Cantidad = Cantidad + 1
			WHERE IdProducto = @IdProducto AND IdUsuario = @IdUsuario;	
		END
		ELSE
		BEGIN
			UPDATE Carrito
			SET Cantidad = @Cantidad
			WHERE IdProducto = @IdProducto AND IdUsuario = @IdUsuario;
		END

	END
	ELSE
	BEGIN
	    INSERT INTO Carrito (IdProducto, IdUsuario, Cantidad, DVH)
	    VALUES (@IdProducto, @IdUsuario, 1, 0);
	END
END
GO
