/****** Object:  StoredProcedure [dbo].[sp_ObtenerProductosMasCompradosPorMesYAnio]    Script Date: 12/11/2024 21:40:35 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[sp_ObtenerProductosMasCompradosPorMesYAnio]
AS
BEGIN
    SET NOCOUNT ON;

    SELECT 
        YEAR(Compra.FechaPago) AS Anio,
        MONTH(Compra.FechaPago) AS Mes,
        Producto.Nombre, 
        SUM(DetalleCompra.Cantidad) AS VecesComprado
    FROM 
        Compra
    INNER JOIN 
        DetalleCompra ON Compra.Id = DetalleCompra.IdCompra
    INNER JOIN 
        Producto ON DetalleCompra.IdProducto = Producto.Id
    GROUP BY 
        YEAR(Compra.FechaPago), 
        MONTH(Compra.FechaPago), 
        Producto.Nombre
    ORDER BY 
        Anio DESC, 
        Mes DESC, 
        VecesComprado DESC;
END
GO
