CREATE PROCEDURE [dbo].[sp_s_usuarioDocumento_porUsuario]
	@Firmado int,
	@IdUsuario int
AS
BEGIN
	SELECT ud.IdDocumento, d.Nombre, ud.FechaEntrega, ud.FechaFirma, ud.Firmado, d.Contenido FROM UsuarioDocumento ud
	INNER JOIN Documentos d ON d.Id = ud.IdDocumento
	WHERE IdUsuario = @IdUsuario AND Firmado = @Firmado
END
