CREATE PROCEDURE [dbo].[sp_u_empresa]
    @Id INT,
    @Nombre NVARCHAR(100),
    @Logo VARBINARY(MAX) = NULL,
    @URL NVARCHAR(100)
AS
BEGIN
    SET NOCOUNT ON;

    UPDATE Empresa 
    SET 
        Nombre = @Nombre,
        Logo = CASE WHEN @Logo IS NOT NULL THEN @Logo ELSE Logo END,
        URLEmpresa = @URL
    WHERE
        Id = @Id

    SELECT @Id AS Id
END
GO
