CREATE PROCEDURE [dbo].[sp_u_permisoUsuario]
    @Email NVARCHAR(100),
	@IdPuesto INT
AS
BEGIN
declare @IdUsuario int
declare @IdUsuarioPermiso int
    SET NOCOUNT ON

	UPDATE Usuario 
	SET 
		IdPuesto = @IdPuesto
	WHERE
		Email = @Email

	SELECT @IdUsuario = Id FROM Usuario where Email = @Email

	SELECT @IdUsuarioPermiso = up.Id FROM UsuarioPermiso up
	INNER JOIN Permiso p ON p.Id = up.PatenteId
	WHERE 
		up.UsuarioId = @IdUsuario and
		p.Permiso is null

	IF(@IdUsuarioPermiso is not null)
	BEGIN
		DELETE FROM UsuarioPermiso WHERE Id = @IdUsuarioPermiso
	END
	
	INSERT INTO UsuarioPermiso
	(
		UsuarioId, 
		PatenteId, 
		DVH
	)
	VALUES
	(
		@IdUsuario,
		@IdPuesto,
		0
	)
END
GO
