CREATE PROCEDURE [dbo].[sp_u_producto]
    @Id INT,
    @Nombre NVARCHAR(100),
	@IdEmpresa INT,
    @Imagen VARBINARY(MAX) = NULL,
	@Descripcion NVARCHAR(100),
	@IdTipoProducto INT,
	@Cantidad INT,
    @PrecioUnitario DECIMAL(18,0)
AS
BEGIN
    SET NOCOUNT ON;

    UPDATE Producto 
    SET 
        Nombre = @Nombre,
		IdEmpresa = @IdEmpresa,
        Imagen = CASE WHEN @Imagen IS NOT NULL THEN @Imagen ELSE Imagen END,
		Descripcion = @Descripcion,
		IdTipoProducto = @IdTipoProducto,
		Cantidad = @Cantidad,
		PrecioUnitario = @PrecioUnitario
    WHERE
        Id = @Id

    SELECT @Id AS Id
END
GO
