CREATE PROCEDURE [dbo].[sp_u_usuario]
    @Email NVARCHAR(100),
	@IdPuesto INT,
	@IdArea INT,
	@Genero NVARCHAR(30),
	@Direccion nvarchar(100),
	@NumeroDireccion int, 
	@Departamento nvarchar(5),
	@CodigoPostal nvarchar(5),
	@Ciudad nvarchar(100),
	@Provincia nvarchar(100),
	@Pais nvarchar(50)
AS
BEGIN
    SET NOCOUNT ON

	UPDATE 
		Usuario 
	SET 
		IdPuesto = @IdPuesto,
		IdArea = @IdArea,
		Genero = @Genero,
		Direccion = @Direccion,
		NumeroDireccion = @NumeroDireccion,
		Departamento = @Departamento,
		CodigoPostal = @CodigoPostal,
		Ciudad = @Ciudad,
		Provincia = @Provincia,
		Pais = @Pais
	WHERE
		Email = @Email

    SELECT Id 
    FROM Usuario 
    WHERE Email = @Email
END
GO
